import React from "react";

import Col from "react-bootstrap/Col";
import Raw from "react-bootstrap/Row";

import "./styles.css";

const Price = (props) => {
  return (
    <Raw>
      <a>Empresa</a>
      <Col xs={6} md={4}>
        Precio actual:
        <p>$ 2,000.00</p>
      </Col>
      <Col xs={6} md={4}>
        Cierre anterior:
        <p>$ 2,000.00</p>
      </Col>
      <Col xs={6} md={4}>
        Variacion:
        <p>$ 2,000.00</p>
      </Col>
    </Raw>
  );
};

export default Price;
